'use strict';
class InstrumentDescriptorFindingResult {
    descriptors;
    error;
    static create(descriptors, error) {
        let result;
        result = new InstrumentDescriptorFindingResult();
        result.descriptors = descriptors;
        result.error = error;
        return result;
    }
    getResult() {
        return this.descriptors;
    }
    getError() {
        return this.error;
    }
}
module.exports = InstrumentDescriptorFindingResult
